create or replace function fun_default_check_018(num int) return varchar
is
 v_lang clob := 'abc';
BEGIN
 FOR I IN 1 .. num
 LOOP
  v_lang := v_lang || 'efg';
 END LOOP;
 return v_lang;
END;
/
drop table if exists t_default_check_018;
create table t_default_check_018(id int,c_int int,c_vchar varchar(100) default fun_default_check_018(40),c_clob clob,c_blob blob,c_date date);
