--函数变更  
create or replace function fun_default_check_018(num int) return varchar
is
 v_lang clob := 'abc';
BEGIN
 FOR I IN 1 .. num
 LOOP
  v_lang := upper(v_lang || 'efgaaaaaaaaaaa');
 END LOOP;
 return v_lang;
END;
/

