drop table if exists t_default_check_501;
create table t_default_check_501(
id int,
c_int int default 99,
c_real real default 1+1+1+1+abs(-1)+cos(0.5),
c_float float,
c_decimal decimal,
c_number number,
c_char char(10),
c_vchar varchar(10) default 'abc' check (c_vchar in('abc') or length(c_vchar)>0),
c_vchar2 varchar2(100),
c_clob clob default '1+2+1.1'||SUBSTR('array[1,2,3] t_default_check_002 ', 3)||null||case when 1>0 then 2 end,
c_long clob,
c_blob blob,
c_raw raw(100),
c_date date,
c_timestamp timestamp,
constraint t_default_check_501con1 check(c_int<1000000 and id>0 or concat(c_int,null,c_real)>0 and c_vchar like '%abc%'),
constraint t_default_check_501con2 check(c_int>-1000000),
constraint t_default_check_501con3 check(c_int between length('a') and 100000000 and length(c_clob)>0 and c_int+c_real>0)
)
PARTITION BY RANGE(id)
(
